-- SHA-256 instead of md5 for hashing password
USE icewien;

CREATE TABLE parlor (
  id INTEGER AUTO_INCREMENT,
  name VARCHAR(255),
  latitude VARCHAR(30),
  longitude VARCHAR(30),
  opening_time TIME,
  closing_time TIME,
  street VARCHAR(255),
  street_numb INTEGER,
  zip INTEGER,
  phone VARCHAR(255),
  menu VARCHAR(255) DEFAULT NULL,
  PRIMARY KEY (id)
);



CREATE TABLE flavour (
  name VARCHAR(255),
  confirmed BOOLEAN DEFAULT FALSE,
  parlor_id INTEGER,
  PRIMARY KEY (name, parlor_id),
  FOREIGN KEY (parlor_id) REFERENCES parlor (id)
);



CREATE TABLE user (
  uid INTEGER AUTO_INCREMENT,
  email VARCHAR(255),
  username VARCHAR(255),
  password BINARY(64),
  isAdmin BOOLEAN,
  PRIMARY KEY (uid)
);

CREATE TABLE vote (
  date TIMESTAMP,
  ranking INTEGER(5),
  uid INTEGER,
  parlor_id INTEGER,
  PRIMARY KEY (date, uid),
  FOREIGN KEY (uid) REFERENCES user (uid)
);